{
  "name": "UBX-NAV-TIMEQZSS",
  "class_id": "0x01",
  "message_id": "0x27",
  "message_type": "periodic_polled",
  "payload_length": {
    "fixed": 20
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
    },
    {
      "byte_offset": 4,
      "data_type": "U4",
      "name": "qzssTow",
      "unit": "S",
      "description": "QZSS time of week (rounded to seconds)"
    },
    {
      "byte_offset": 8,
      "data_type": "I4",
      "name": "fQzssTow",
      "unit": "ns",
      "description": "Fractional part of QZSS time of week (range: +/-500000000)."
    },
    {
      "byte_offset": 12,
      "data_type": "I2",
      "name": "qzssWno",
      "description": "QZSS week number of the navigation epoch"
    },
    {
      "byte_offset": 14,
      "data_type": "I1",
      "name": "leaps",
      "unit": "S",
      "description": "QZSS leap seconds (QZSS-UTC)"
    },
    {
      "byte_offset": 15,
      "data_type": "X1",
      "name": "valid",
      "description": "Validity Flags",
      "bit_fields": [
        {
          "bit_offset": 0,
          "bit_length": 1,
          "name": "qzssTowValid",
          "description": "1 = Valid QZSS time of week (qzssTow & fQzssTow, see Time Validity section for details)"
        },
        {
          "bit_offset": 1,
          "bit_length": 1,
          "name": "qzssWnoValid",
          "description": "1 = Valid QZSS week number (see Time Validity section for details)"
        },
        {
          "bit_offset": 2,
          "bit_length": 1,
          "name": "leapSValid",
          "description": "1 = Valid QZSS leap seconds"
        }
      ]
    },
    {
      "byte_offset": 16,
      "data_type": "U4",
      "name": "tAcc",
      "unit": "ns",
      "description": "Time Accuracy Estimate"
    }
  ]
}
